import { useState } from "react";


function Register(){
    const [name,setName]=useState("")
    const [email,setEmail]=useState("")
    const [pswd,setPswd]=useState("")
    const [cpswd,setCpswd]=useState("")
    return(
<div>
<form className="card p-5 m-3" style={{width:"500px"}}>
  <div className="mb-3">
    <label className="form-label">Full Name</label>
    <input type="text" value={name} onChange={e=>setName(e.target.value)} className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
  </div>
  <div className="mb-3">
    <label className="form-label">Email</label>
    <input type="email" value={email} onChange={e=>setEmail(e.target.value)} className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
  </div>
  <div className="mb-3">
    <label  className="form-label">Password</label>
    <input type="password" value={pswd} onChange={e=>setName(e.target.value)} className="form-control" id="exampleInputPassword1"/>
  </div>
  <div className="mb-3">
    <label  className="form-label">Confirm Password</label>
    <input type="password" value={cpswd} onChange={e=>setName(e.target.value)} className="form-control" id="exampleInputPassword1"/>
  </div>
  <button type="submit" className="btn btn-primary">Submit</button>
</form>
</div>
    )
}
export default Register;
